import React from 'react'
import {Button} from "@chakra-ui/react"
import { Tracker } from '../components/Tracker'
import { Chart } from '../components/Chart'
import { useState } from 'react'

export const Dashboard = () => {
    const[compo,setCompo]=useState("tracker")
  return (
    <div>
        <Button onClick={(e)=>setCompo("tracker")}>Tracker</Button>
        <Button onClick={(e)=>setCompo("chart")}>Analytics</Button>
        <Button onClick={(e)=>setCompo("history")}>History</Button>

        {compo=="tracker" &&<Tracker/>}
        {compo=="chart" &&<Chart/>}
        {compo=="history" &&<Tracker/>}
        
    </div>
  )
}
